      <div className="overflow-x-auto overflow-y-hidden whitespace-nowrap p-4 bg-gray-100 rounded-lg">
        <div
          className="inline-block w-[1200px] h-24 bg-gradient-to-r from-red-400 to-teal-400 text-white font-sans text-lg text-center leading-[6rem]"
        >
          Scroll horizontally to see more content
        </div>
      </div>
    </div>
    </>
  );
}
